import Link from "next/link";

export default function Navbar() {
  return (
    <ul className="navbar">
      <li>
        <Link href="/">
          <a>HOME</a>
        </Link>
      </li>
      <li>
        <Link href="/about">
          <a>ABOUT</a>
        </Link>
      </li>
      <li>
        <Link href="/contact">
          <a>CONTACT</a>
        </Link>
      </li>
      <li>
        <Link href="/gallery">
          <a>GALLERY</a>
        </Link>
      </li>
      <style jsx>{`
        .navbar {
          // position: fixed;
          list-style-type: none;
        }
      `}</style>
    </ul>
  );
}
